import { IDorm, SIDES } from "../models";
export const SWITCH_IDS_COLLECTION = {
    SWITCH_1: 'switch-1',
    SWITCH_2: 'switch-2',
}
export const FLOOR_IDS_COLLECTION = {
    CENTRAL: 'central',
    FLOOR_1: 'floor-1',
    FLOOR_2: 'floor-2',
    FLOOR_3: 'floor-3',
    FLOOR_4: 'floor-4',
}

export const SWITCH_IPS_COLLECTION = {
    [SWITCH_IDS_COLLECTION.SWITCH_1]: '192.1.1.1',
    [SWITCH_IDS_COLLECTION.SWITCH_2]: '192.1.2.1',
}

export const switchesMock = {
    [SWITCH_IDS_COLLECTION.SWITCH_1]: {
        name: "Floor 1 Left",
        id: SWITCH_IDS_COLLECTION.SWITCH_1,
        addr_ipv4: "192.168.***.***",
        telnet: "yes/no",
        model: "sample model switch",
        sample_element: "sample_data",
        side: SIDES.LEFT,
        commands: ['srv', 'Bl1ght2000@@', 'ls']
    },
    [SWITCH_IDS_COLLECTION.SWITCH_2]: {
        name: "Floor 1 Right",
        id: SWITCH_IDS_COLLECTION.SWITCH_2,
        addr_ipv4: "192.168.***.***",
        telnet: "yes/no",
        model: "sample model switch",
        sample_element: "sample_data",
        side: SIDES.RIGHT,
        commands: ['ls', 'ls', 'ls']
    }
}
export const floorsMock = {
    [FLOOR_IDS_COLLECTION.CENTRAL]: {
        name: "Central",
        id: FLOOR_IDS_COLLECTION.CENTRAL,
        addr_ipv4: "192.168.***.***",
        telnet: "yes/no",
        model: "sample model switch",
        sample_element: "sample_data"
    },
    [FLOOR_IDS_COLLECTION.FLOOR_1]: {
        name: "Floor 1",
        id: FLOOR_IDS_COLLECTION.FLOOR_1,
        switches: [
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_1],
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_2]
        ]
    },
    [FLOOR_IDS_COLLECTION.FLOOR_2]: {
        name: "Floor 1",
        id: FLOOR_IDS_COLLECTION.FLOOR_2,
        switches: [
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_1],
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_2]
        ]
    },
    [FLOOR_IDS_COLLECTION.FLOOR_3]: {
        name: "Floor 1",
        id: FLOOR_IDS_COLLECTION.FLOOR_3,
        switches: [
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_1],
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_2]
        ]
    },
    [FLOOR_IDS_COLLECTION.FLOOR_4]: {
        name: "Floor 4",
        id: FLOOR_IDS_COLLECTION.FLOOR_4,
        switches: [
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_1],
            switchesMock[SWITCH_IDS_COLLECTION.SWITCH_2]
        ]
    },
};

export default [
    {
        name: "Dorm1",
        id: 'dorm-1',
        floors: [
            floorsMock[FLOOR_IDS_COLLECTION.CENTRAL],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_1],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_2],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_3],
        ]
    },
    {
        name: "Dorm2",
        id: 'dorm-2',
        floors: [
            floorsMock[FLOOR_IDS_COLLECTION.CENTRAL],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_1],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_2],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_3],
        ]
    },
    {
        name: "Dorm3",
        id: 'dorm-3',
        floors: [
            floorsMock[FLOOR_IDS_COLLECTION.CENTRAL],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_1],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_2],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_3],
            floorsMock[FLOOR_IDS_COLLECTION.FLOOR_4],
        ]
    },
] as IDorm[]
